 --#-#
 -- add trigger into voucher
 create Trigger autoAddVoucherCloseDate
 After UPDATE OF status on Voucher
 FOR EACH ROW
 WHEN NEW.status=3
 BEGIN
     update 'Voucher' SET closedTime=(datetime('now','localtime')) where id=NEW.id;
     update 'Voucher' SET totalPrice=IfNull((
     select
     SUM(o.qty*pp.price)
     from 'Order' o
     inner join 'Inventory' i on o.item=i.id
     inner join 'ProductPrice' pp on pp.id=i.currentPrice
     where o.voucher=New.id
     Group By o.voucher
     ),0 ) where id=NEW.id;
 END;
